import axios from "axios";

async function updateSkateStatusActive(userId, obj) {
  try {
    let response = await axios.put(
      "http://localhost:3007/api/skateSta/active/" + userId,
      obj
    );
    if (response) {
      return response.data;
    }
  } catch (error) {
    console.log("Error adding friend: " + error);
  }
}
async function updateSkateStatusInactive(userId, obj) {
  try {
    let response = await axios.put(
      "http://localhost:3007/api/users/inactive/" + userId,
      obj
    );
    if (response) {
      return response.data;
    }
  } catch (error) {
    console.log("Error adding friend: " + error);
  }
}

const AxiosSkateStatus = {
  updateSkateStatusActive,
  updateSkateStatusInactive,
};
export default AxiosSkateStatus;
